One of the most beautiful scrambles-easy climbs I often do is the north ridge on Store Trolltind. Starting from Åndalsnes a few flat kilometers before starting a steep 1800m uphill that ends with this ridge that have great views over the Trollveggen (or Trollwall). Is one of this places where no matter how many times you go there the smallness feeling is always so powerful. From the summit you can downclimb or run to trollstigen and back, on nice easy trails where you can try to get some speed. A great training loop. 

